INSERT INTO `question` VALUES (306,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'If you were me, what changes would you make?'),(307,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How do you prefer to receive feedback?'),(308,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you feel you’re getting enough feedback? Why/why not?'),(309,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What aspect of your job you would like more help or coaching?'),(310,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How can I better support you?'),(311,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What could I do as a manager to make your work easier?'),(312,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What is something I could do better? What feedback do you have for me?'),(313,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What aspects of your work would you like more or less direction from me?'),(314,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What would you like to know about me?'),(315,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What do you like about my management style? What do you dislike?'),(316,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What have your past managers done that you’d like me to also do or not do?'),(317,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What’s your favorite thing I do as a manager of this team I should keep doing?'),(318,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Where do you think I can be most helpful?'),(319,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your thoughts on my changes?'),(320,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How can I make your days more fulfilling?'),(321,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I be doing better to help you in your job?'),(322,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Are there any obstacles I can remove for you?'),(323,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to help you achieve you current goals and priorities?'),(324,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to make things more manageable?'),(325,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How might I make this project more challenging or interesting for you?'),(326,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What do you think I should know about the project, but might not?'),(327,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What is the biggest challenge you are currently facing? How can I help with that?'),(328,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'At what point in the past week were you most frustrated with or discouraged by your work? What can I do to help you manage that?'),(329,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What additional resources can I provide for you between now and the next time we meet?'),(330,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'I’ve noticed that our last several 1-on-1s have stayed pretty surface. What are your honest impressions of this meeting? What could we be doing differently or better?'),(331,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What would you like to see change about these discussions? How could we make them more useful for you?'),(332,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'I’m trying to make my 1-on-1s better and would appreciate your honest feedback on this one — what did you like about it, and what could be improved?'),(334,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'I''d like to improve as a manager and I could really use your help. Next week, would you be willing to share some feedback on one to two things you think I could do better as your manager?'),(335,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to help you enjoy your work more or remove roadblocks to progress?'),(336,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Which areas would you like more or less direction from me on your work?'),(337,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your impressions of our 1-on-1s? What could we do differently or better?'),(338,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you think that you receive enough feedback? Is feedback helpful for your personal development? What can I do to help you get the feedback you want?'),(339,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Would you like more coaching? What aspect of your job do you like more help and coaching on?'),(340,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do as a manager to make your work easier?'),(341,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What is the percentage of my involvement in your daily tasks? Would you prefer more or less?'),(343,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What is something I could have done better? What are the situations that I could have helped more but didn’t?'),(344,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to help you?'),(345,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What is the one thing that you need the most from me?'),(346,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'As your manager, what would you like me to stop, start, or continue doing?'),(347,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to help remove obstacles?'),(348,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you have any feedback for me?'),(350,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to make your job easier?'),(352,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do for you that I''m not?'),(355,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do better or differently as your manager to support you?'),(356,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How could I do a better job communicating with you?'),(357,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What do you want to be doing in 5 years? 10 years? 3 years?'),(358,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your long term goals? Have you thought about them?'),(359,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your super powers? What powers would you like to develop?'),(360,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What do you want to do in your next job?'),(361,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What skills would you like to develop right now?'),(362,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What additional training or education would you like?'),(363,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you feel like you’re making progress on your big goals here? Why or why not?'),(364,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What’s one thing we could do today to help you with your long term goals?'),(365,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you feel we’re helping you advance your career at a pace you would like?'),(366,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your big dreams in life? Are you making progress on them?'),(367,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Could you see yourself making progress on more of your goals here? What would need to change to do so?'),(369,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Are there any events or training you’d like to attend to help you grow your skills?'),(370,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Who in the company would you like to learn from? What do you want to learn?'),(371,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can you do to take action or make progress on what we talked about today?'),(372,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What can I do to take action or make progress on what we talked about today?'),(373,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Where do you see your career in the next (2/5/10) years?'),(374,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What work are you doing here that you feel is most in line with your long term goals?'),(375,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What skills are required to reach your goals?'),(376,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are some of the work projects you’re most proud of, and what do you think you might want to do next?'),(377,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are two to three new skills you’d like to learn on the job? What about those skills interests you?'),(378,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What other roles here could you see yourself in down the line? Or what areas would you like to explore?'),(379,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'If you were to create your ideal position, how would it differ from what you are currently doing?'),(380,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How is your current work helping or hurting your professional development?'),(381,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Which career or development goals do you feel like you’re not able to focus on right now?'),(382,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What else can I be doing to help you grow/advance in your career?'),(383,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Imagine it’s two years from now, and things have gone well: What has been your role in that? What does your role look like?'),(384,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Have you given any more thought to your long-term goals since our last meeting? What are your latest thoughts?'),(385,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Where do you see yourself in three years? Five years?'),(386,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What professional goals would you like to accomplish in the next 6 to 12 months, and what makes you say that?'),(387,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'To help identify and clarify the goal: What do you want to achieve? What will you do to achieve it? When will you do it? Who do you need to involve? When should you see results?'),(388,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What about this goal is important to you and what will be different when you achieve the goal?'),(389,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What sort of progress have you made on the next steps we discussed last time?'),(390,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What development areas do you want to work on in the coming weeks?'),(391,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What actions will you take before our next 1-on-1 to make progress on X? (Also discuss and agree on actions you will take to help.)'),(392,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'During this meeting you’ve mentioned that you’d like to pursue X. What steps can you take toward that before our next 1-on-1?'),(393,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Have you ever felt undervalued here?'),(394,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are the projects you would be interested in working on next?'),(396,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How do you think about your progress on your big goals? What needs to be done to move towards the goals? What can we do to help?'),(397,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Which part of the work here do you feel as most relevant to your long-term goals? What kinds of projects do you want to take part in to move toward your goals?'),(398,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you feel like you are learning at work? What are the new things you learned lately? What are the areas you want to learn about?'),(399,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Do you have the tools you need to reach your goals?'),(400,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How do you think you did on your performance review this year? What do you think the results will be?'),(401,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Where do you see your career in 1 year, 3 years? What can you do to make sure you reach those goals? How can we as HR help you to reach those goals (assuming the goals relate to the company)?'),(402,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Is there a different way we can develop your skills   outside of traditional training?'),(403,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What would make this your perfect job?'),(404,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Are there any projects you’d really like to work on if you were given the opportunity?'),(405,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What parts of your job would you like to deepen your skills in or get additional training in?'),(406,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Is there an aspect of your job you would like more help or coaching?'),(407,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What areas of your job do you find difficult that getting better skills at would help?'),(408,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What skills do you have that you think are underutilized?'),(409,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What capabilities do you want to develop?'),(410,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Tell me about something new you learned since we met last.'),(411,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What opportunities have you had recently to learn something new?'),(412,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What would you like to learn about in the future?'),(413,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What kind of training or experience would be most helpful to you right now?'),(414,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What do you see as the next step in your career?'),(415,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What goals have you set for your career?'),(416,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How do you feel you are progressing in your career?'),(417,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What big questions do you have about your career opportunities in the future?'),(418,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'What are your goals (for our group for you personally)'),(419,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'Tell me a story...'),(420,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'How are you? How is life outside of work?'),(421,'2022-12-18 08:41:45.431360','2022-12-18 08:41:45.431360',NULL,'If around a holiday: Do you celebrate [Holiday]? If so, can I ask what are you plans?'),(422,'2022-12-18 0